import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Login from "./container/login";
import product from "./container/product/product";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/product" element={<product />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
